To define a generic type or function, a type signature needs to have a list of generic parameters enclosed in angle brackets (< and >). The generic parameters are separated by commas. /// Container for any type `T`.
public struct Container<T> has drop { value: T,
} /// Function that creates a new `Container` with a generic value `T`.
public fun new<T>(value: T): Container<T> { Container { value }
} In the example above, Container is a generic type with a single type parameter T, the value field of the container stores the T. The new function is a generic function with a single type parameter T, and it returns a Container with the given value. Generic types must be initialed with a concrete type, and generic functions must be called with a concrete type. #[test]
fun test_container() { // these three lines are equivalent let container: Container<u8> = new(10); // type inference let container = new<u8>(10); // create a new `Container` with a `u8` value let container = new(10u8); assert!(container.value == 10, 0x0); // Value can be ignored only if it has the `drop` ability. let Container { value: _ } = container;
} In the test function test_generic we demonstrate three equivalent ways to create a new Container with a u8 value. Because numeric types need to be inferred, we specify the type of the number literal.

