fun test_swap_type_params() { let pair1: Pair<u8, bool> = new_pair(10u8, true); let pair2: Pair<bool, u8> = new_pair(true, 10u8); // this line will not compile // assert!(pair1 == pair2, 0x0); let Pair { first: pf1, second: ps1 } = pair1; // first1: u8, second1: bool let Pair { first: pf2, second: ps2 } = pair2; // first2: bool, second2: u8 assert!(pf1 == ps2, 0x0); // 10 == 10 assert!(ps1 == pf2, 0x0); // true == true
} Types for variables pair1 and pair2 are different, and the comparison will not compile.

