The transfer::freeze_object function is public function used to put an object into an immutable state. Once an object is frozen , it can never be changed, and it can be accessed by anyone by immutable reference. The function signature is as follows, only accepts a type with the key ability . Just like all other storage functions, it takes the object by value : // File: sui-framework/sources/transfer.move
public fun freeze_object<T: key>(obj: T); Let's expand on the previous example and add a function that allows the admin to create a Config object and freeze it: /// Some `Config` object that the admin can `create_and_freeze`.
public struct Config has key { id: UID, message: String
} /// Creates a new `Config` object and freezes it.
public fun create_and_freeze( _: &AdminCap, message: String, ctx: &mut TxContext
) { let config = Config { id: object::new(ctx), message }; // Freeze the object so it becomes immutable. transfer::freeze_object(config);
} /// Returns the message from the `Config` object.
/// Can access the object by immutable reference!
public fun message(c: &Config): String { c.message } Config is an object that has a message field, and the create_and_freeze function creates a new Config and freezes it. Once the object is frozen, it can be accessed by anyone by immutable reference. The message function is a public function that returns the message from the Config object. Config is now publicly available by its ID, and the message can be read by anyone. Function definitions are not connected to the object's state. It is possible to define a function that takes a mutable reference to an object that is used as frozen. However, it won't be callable on a frozen object. The message function can be called on an immutable Config object, however, two functions below are not callable on a frozen object: // === Functions below can't be called on a frozen object! === /// The function can be defined, but it won't be callable on a frozen object.
/// Only immutable references are allowed.
public fun message_mut(c: &mut Config): &mut String { &mut c.message } /// Deletes the `Config` object, takes it by value.
/// Can't be called on a frozen object!
public fun delete_config(c: Config) { let Config { id, message: _ } = c; id.delete()
} To summarize: transfer::freeze_object function is used to put an object into an immutable state; Once an object is frozen , it can never be changed, deleted or transferred, and it can be accessed by anyone by immutable reference;

