While the shared object can't normally be taken by value, there is one special case where it can - if the function that takes it deletes the object. This is a special case in the Sui storage model, and it is used to allow the deletion of shared objects. To show how it works, we will create a function that creates and shares a Config object and then another one that deletes it: /// Creates a new `Config` object and shares it.
public fun create_and_share(message: String, ctx: &mut TxContext) { let config = Config { id: object::new(ctx), message }; // Share the object so it becomes shared. transfer::share_object(config);
} The create_and_share function creates a new Config object and shares it. The object is now publicly available as a mutable reference. Let's create a function that deletes the shared object: /// Deletes the `Config` object, takes it by value.
/// Can be called on a shared object!
public fun delete_config(c: Config) { let Config { id, message: _ } = c; id.delete()
} The delete_config function takes the Config object by value and deletes it, and the Sui Verifier would allow this call. However, if the function returned the Config object back or attempted to freeze or transfer it, the Sui Verifier would reject the transaction. // Won't work!
