Utilizing objects as capabilities is a relatively new concept in blockchain programming. And in other smart-contract languages, authorization is often performed by checking the address of the sender. This pattern is still viable on Sui, however, overall recommendation is to use capabilities for better security, discoverability, and code organization. Let's look at how the new function that creates a user would look like if it was using the address check: /// Error code for unauthorized access.
const ENotAuthorized: u64 = 0; /// The application admin address.
const APPLICATION_ADMIN: address = @0xa11ce; /// Creates a new user in the system. Requires the sender to be the application
/// admin.
public fun new(ctx: &mut TxContext): User { assert!(ctx.sender() == APPLICATION_ADMIN, ENotAuthorized); User { id: object::new(ctx) }
} And now, let's see how the same function would look like with the capability: /// Grants the owner the right to create new users in the system.
public struct AdminCap {} /// Creates a new user in the system. Requires the `AdminCap` capability to be
/// passed as the first argument.
public fun new(_: &AdminCap, ctx: &mut TxContext): User { User { id: object::new(ctx) }
} Using capabilities has several advantages over the address check: Migration of admin rights is easier with capabilities due to them being objects. In case of address, if the admin address changes, all the functions that check the address need to be updated - hence, require a package upgrade . Function signatures are more descriptive with capabilities. It is clear that the new function requires the AdminCap to be passed as an argument. And this function can't be called without it. Object Capabilities don't require extra checks in the function body, and hence, decrease the chance of a developer mistake. An owned Capability also serves in discovery. The owner of the AdminCap can see the object in their account (via a Wallet or Explorer), and know that they have the admin rights. This is less transparent with the address check. However, the address approach has its own advantages. For example, if an address is multisig, and transaction building gets more complex, it might be easier to check the address. Also, if there's a central object of the application that is used in every function, it can store the admin address, and this would simplify migration. The central object approach is also valuable for revokable capabilities, where the admin can revoke the capability from the user.

